    str_perm = ''.join(permutation)
    # Check for D and E not being next to each other and FG being together
    if 'DE' not in str_perm and 'ED' not in str_perm and ('FG' in str_perm or 'GF' in str_perm):
        # Check if A is in the middle of B and C, not necessarily next to each other
        for i in range(len(permutation)):
            if permutation[i] == 'A':
                # Check positions of B and C related to A
                if ('B' in permutation[:i] and 'C' in permutation[i+1:]) or ('C' in permutation[:i] and 'B' in permutation[i+1:]):
