    # A number is divisible by 9 if the sum of its digits is divisible by 9
    # The sum of the fixed digits 4+7+1+9 = 21
    # The remaining sum needed for the number to be divisible by 9 = 9 * k - 21, where k is a positive integer
    # As A, B, C are digits, their minimum value is 0 and maximum is 9

    for A in range(10):
