                        and C not in {4, 7, 1, 9}:
                    digit_sum = 21 + A + B + C
                    if digit_sum % 9 == 0:
                        return A + B + C, f'47A1B9C'.replace('A', str(A)).replace('B', str(B)).replace('C', str(C))

