def solution():
    # This is a classic problem of derangements, sometimes known as subfactorials or !n,
    # which count the number of permutations of n elements with no fixed points.

    def subfactorial(n):
        # Using the recurrence relation:
        # !n = (n-1)(!(n-1) + !(n-2))
        if n == 0:
            return 1
        elif n == 1:
            return 0
        else:
            return (n-1) * (subfactorial(n-1) + subfactorial(n-2))

    return subfactorial(7)

ans = solution()

