from sympy import divisors

def solution():
    # Given: HCF of M and N is 75 which is 3^1 * 5^2
    # Since M has 12 factors, we can consider the form M = 3^a * 5^b
    # The number of factors of M is given by (a + 1)(b + 1) = 12

    # Create a function to find the possibilities for the power of prime factors
    # given the number of divisors it should have
    def find_possible_powers(num_divisors, excluded_powers):
        possibilities = []
        for a in range(num_divisors):
            for b in range(num_divisors):
                if (a + 1) * (b + 1) == num_divisors and {a, b}.isdisjoint(excluded_powers):
                    possibilities.append((a, b))
        return possibilities

    # Find the possible power combinations for M (12 divisors) and N (10 divisors)
    # The excluded power for M and N includes the HCF's powers, so they both exclude {1, 2}
    possible_powers_M = find_possible_powers(12, {1, 2})
    possible_powers_N = find_possible_powers(10, {1, 2})

    # Now find the actual numbers M and N based on their prime factors
    # We iterate through each possibility and make sure they share the prime factors of HCF
    for a, b in possible_powers_M:
        M = (3 ** (a)) * (5 ** (b)) * 75  # Multiplying by HCF to include the prime factors of it
        for c, d in possible_powers_N:
            N = (3 ** (c)) * (5 ** (d)) * 75  # Multiplying by HCF to include the prime factors of it

            # Checking if the number of divisors match what was provided
            if len(divisors(M)) == 12 and len(divisors(N)) == 10:
                return M + N

# Compute the answer
